import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './pages/Home';
import Admin from './pages/Admin';


const App = () => {
  return(
    <> 
      <BrowserRouter>
        <Route path="/" components={Home} /> //lien vers la page Home 
        <Route path="/" components={Admin} /> //Lien vers la page admin

      </BrowserRouter>

    </>
    );

};

export default App;
